script: |
  super -f tsv -I q5302.sql | sort > q5302.out

vector: true

inputs:
  - name: q5302.sql
    data: |
      SELECT ALL + - col0 FROM tab1 WHERE NOT + col2 NOT BETWEEN + ( - - col0 ) * - - ( - col0 ) / col1 + + col2 AND + + 1 * + + col0;
  - name: tab1

outputs:
  - name: q5302.out
    data: |
      -85
      -91
